import React from "react";
import { Card, Tabs, Input, Radio, Button, Form } from "antd";

const { TabPane } = Tabs;

const PlaceOrders = () => {
	return (
		<section>
			{/* buy order seperate component, sell order seperate, load dynamically */}
			<div
				style={{ position: "absolute", top: "5px", zIndex: "5", left: "5px" }}
			>
				<button type="button" className="buyButton">
					BUY
				</button>
				<button type="button" className="sellButton">
					SELL
				</button>
			</div>
			<Card className="placeOrders" style={{ textAlign: "center" }}>
				<Form
					labelCol={{ span: 0 }}
					wrapperCol={{ span: 18 }}
					layout="horizontal"
					size="large"
				>
					<Form.Item label="">
						<Input />
					</Form.Item>
					<Form.Item label="">
						<Input />
					</Form.Item>
				</Form>
			</Card>
		</section>
	);
};

export default PlaceOrders;
